import React from "react";
import { CreatePost }from './CreatePost'

export const Popup = () => {

  return (
    <>
      <div className="popup">
        <CreatePost />
        <h3>Create Post</h3>
        <form>
          <input type="textarea" value="Write your Post...."></input>
          <input type="button" value="Submit"></input>
        </form>
      
      </div>
      
    </>);
};
